// src/App.tsx
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import About from './components/About/About';
import BlogPosts from './components/BlogPosts/BlogPosts';
import { allBlogComponents } from './blogContent/BlogUtils';

function App() {
    return (
        <Router>
            <div>
                <Routes>
                    <Route path="/blog" element={<BlogPosts />} />
                    {Object.keys(allBlogComponents).map((componentName) => {
                        const BlogComponent = allBlogComponents[componentName];
                        const path = `/blog/${componentName}`;

                        return (
                            <Route key={componentName} path={path} element={<BlogComponent />} />
                        );
                    })}
                    <Route path="/" element={<About />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
